import './App.css';
import React,{ useState , useEffect } from 'react';
import Todo from './Todo'

function App() {

  const [todos, setTodos] = React.useState([
    { text: "Welcome to" },
    { text: "To-Do List..." },
    { text: "Lets begin !!!" }
  ]);

  return (
    <div>
      <div className="todo-list">
        {todos.map((todo, index) => (
          <Todo
            key={index}
            index={index}
            todo={todo}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
